import React from 'react';
import BackgroundImg from './background.jpeg';
import Hiking from './hiking.jpeg';

export default function About() {
  return (
    <div>
    <img class="top-image" src={BackgroundImg}></img> 
        <div class="row">
            <div id="about" class="jumbotron jumbo-style col-md-7">

                <h1 class="display-4">Hello!</h1>
                <p class="lead">I am a Los Angeles based full-stack web developer who is passionate about bringing creative ideas to life.
                  I am especially interested in Python and Solididty. With years of management experience, collaborating and directing projects are my specialty.
                  I love coding because it allows me to be a problem solver. When im not coding you can find me outdoors; hiking, mountain-biking and camping. 
                </p>
              </div>
              <div class="col-md-3">
                <div class="card animationCard" style="width: 30rem; height: 31rem;">
                  <div class="card-body">
                    <p class="card-text">[ . . . ]</p>
                  </div>
                </div>
              </div>
            </div>
        </div>
  );
}
